import { useContext } from "react";
import { MoonLoader } from "react-spinners";
import { GuildContext } from "../utils/contexts/GuildContext";
import { useFetchGuildConfig } from "../utils/hooks/useFetchGuildConfig";
import { Button, Container, InputField, Page, Title, Flex } from "../utils/styles";
//const { guild } = useContext(GuildContext);
export const GuildPrefixPage = () => {
  const { guild } = useContext(GuildContext);
const {config, loading, error}  = useFetchGuildConfig((guild && guild.id) || '')

console.log(error)
return( <Page>

<Container style={{}}>
{!loading && config ? (<>
  <Title>Update Command Prefix</Title>
  <form>
  <div>
  <label style={{marginBottom: "100px" }}
  htmlFor="prefix">Current Prefix
  </label>
  </div>
  <InputField style={{marginBottom: "20px"}} id="prefix" value={config.prefix}></InputField>
  <div>
  <Button variant="primary" type="button"> Save</Button>
  <Button variant="secondary"> Reset</Button></div>
  </form> </> ) : (
     <Flex>
     <MoonLoader size={30} color="white"/>
     </Flex> )}
</Container>
</Page>)}
